import React,{Component} from 'react';

class Productdeal extends Component {
    render() {
        return (
            <div>

                <div class="col-xs-2 col-sm-2 col-md-2 col-lg-2">   
                    <img src="this.props.image" className="img-responsive" alt="Image" />
                    <p>this.props.title</p>
                    <span className="giaban">this.props.price</span>
                    <p className="gianhap">this.props.gianhap<span>this.props.coupon</span></p>
                </div>

            </div>
        );
    }
}

export default Productdeal;
